  [],\n\t\"revision_timestamp\": \"2015-07-08T19:13:50.912092\",\n\t\"name\": \"gpm-ground-validation-noaa-s-band-profiler-raw-data-netcdf-format-mc3e-v1\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The S-band Profiler Raw dataset was saved
  in two data formats: netCDF anda proprietary Vaisala SPC format. The numeric values
  in both formats are exactly the same.  The S-band Profiler Raw dataset in the netCDF
  format was gathered during the Midlatitude Continental Convective Clouds Experiment
  (MC3E) in Oklahoma April-June 2011 and consists of uncalibrated Doppler velocity
  spectra data in units of relative power return.  The S-band 2.8 GHz profiler points
  vertically and measures the backscattered power from raindrops and ice particles
  as precipitating cloud systems pass overhead.  The profiler processes radar pulses
  during a 7-second dwell before calculating and saving uncalibrated Doppler velocity
  spectra at each range gate that were separated by 60-meters in the vertical.  Data
  collected during each hour are saved in two files.  All precipitation mode profiles
  are saved in one hourly data file and all attenuated mode profiles are saved in
  another hourly data file.  After calibration, calibrated data can be obtained from
  the S-band Original Dwell and Minute datasets.\",\n\t\"license_title\": \"U.S. Government
